import Link from 'next/link';

const Header = () => (
	<div className="header">
		<Link href="/index">
			<a>Main</a>
		</Link>
		<Link href="/about">
			<a>About Page</a>
		</Link>
		<style jsx>{`
			.header a {
				font-family: Arial, sans-serif;
				padding: 7px;
				selection: none;
				highlight: none;
			}
		`}</style>
	</div>
);

export default Header;
